    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT ( NOT col2 - - col2 BETWEEN col0 AND col0 / - - col0 + 34 * + + col1 + 95 );
  - name: tab1

outputs:
  - name: q3701.out
    data: |
      51	14	96
      85	5	59
      91	47	68
